import React from 'react';
import ReactDOM from 'react-dom';
import json from './db'

//Components

import Header from "./components/header";



const App = () => {
    return <div className='newElement'>
        <div>
            <Header/>
        </div>
        <h1>Hello World</h1>
    </div>
};

ReactDOM.render(<App/>, document.querySelector('#root'));
